from pyspark.sql import SparkSessionfrom pyspark.sql.functions import *spark = SparkSession.builder\    .config("spark.sql.shuffle.partitions", "2")\    .appName("demo01")\    .master("local[2]")\    .getOrCreate()startups = spark.read\    .option("header", "true")\    .option("delimiter", ",")\    .option("inferSchema", "true")\    .csv("/home/sunbeam/startup.csv")# What are the top 5 Industry_Vertical which has the highest number of startups in India?startups.createOrReplaceTempView("startup_view")startups.printSchema()sql = "SELECT Industry_Vertical, COUNT(Startup_Name) cnt FROM startup_view where Industry_Vertical not in ('nan') GROUP BY Industry_Vertical ORDER BY cnt DESC LIMIT 5"result = spark.sql(sql)result.show(truncate=False)spark.stop()